import React, { useState } from 'react';
import axios from 'axios';
import { Form, Button } from 'react-bootstrap';
import './CreateForm.css';

const API_URL = 'http://localhost:5000';

const CreateForm = () => {
  const [formData, setFormData] = useState({
    title: '',
    description: '',
    image: null,
    duration: '',
    activity: '',
    dates: [],
    price: '',
  });

  const handleInputChange = (event) => {
    if (event.target.name === 'dates') {
      const selectedDates = Array.from(event.target.selectedOptions, (option) => option.value);
      setFormData({
        ...formData,
        dates: selectedDates,
      });
    } else {
      setFormData({
        ...formData,
        [event.target.name]: event.target.value,
      });
    }
  };

  const handleImageChange = (event) => {
    setFormData({
      ...formData,
      image: event.target.files[0],
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    const token = localStorage.getItem('token');
    const config = {
      headers: {
        'Content-Type': 'multipart/form-data',
        Authorization: `Bearer ${token}`,
      },
    };

    const formDataToSend = new FormData();
    formDataToSend.append('title', formData.title);
    formDataToSend.append('description', formData.description);
    formDataToSend.append('image', formData.image);
    formDataToSend.append('duration', formData.duration);
    formDataToSend.append('activity', formData.activity);
    formDataToSend.append('dates', JSON.stringify(formData.dates));
    formDataToSend.append('price', formData.price);

    try {
      await axios.post(`${API_URL}/api/my_tour`, formDataToSend, config);

      alert('Запись успешно создана');
      setFormData({
        title: '',
        description: '',
        image: null,
        duration: '',
        activity: '',
        dates: [],
        price: '',
      });
    } catch (error) {
      console.log('Ошибка создания записи', error);
    }
  };

  return (
    <div className="create-form-container">
      <h2>Создать запись</h2>
      <Form onSubmit={handleSubmit} className="create-form">
        <Form.Group>
          <Form.Label>Название:</Form.Label>
          <Form.Control type="text" name="title" value={formData.title} onChange={handleInputChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Описание:</Form.Label>
          <Form.Control as="textarea" name="description" value={formData.description} onChange={handleInputChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Изображение:</Form.Label>
          <Form.Control type="file" name="image" accept="image/*" onChange={handleImageChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Длительность:</Form.Label>
          <Form.Control type="text" name="duration" value={formData.duration} onChange={handleInputChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Вид активности:</Form.Label>
          <Form.Control type="text" name="activity" value={formData.activity} onChange={handleInputChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Дата:</Form.Label>
          <Form.Control type="date" name="dates" value={formData.dates} onChange={handleInputChange} required multiple />
        </Form.Group>
        <Form.Group>
          <Form.Label>Цена:</Form.Label>
          <Form.Control type="text" name="price" value={formData.price} onChange={handleInputChange} required />
        </Form.Group>
        <Button type="submit" className="btn-submit">Создать</Button>
      </Form>
    </div>
  );
};

export default CreateForm;
